import React from "react";
import "../assets/styles/About.scss";

function About() {
  return (
    <div id="about">
      <div className="items-container">
        <h1>About</h1>
        <p>
          I’m a purpose-driven Software Engineer with 5+ years of experience across full-stack
          development, product engineering, and AI systems. I enjoy solving meaningful business
          problems and building scalable technology that drives real impact.
        </p>

        <p>
          I work with Java, Python, React, Spring Boot, AWS, and automation frameworks, and I’m
          known for clear communication—breaking down complex problems into actionable steps and
          collaborating effectively with stakeholders and teams.
        </p>
      </div>
    </div>
  );
}

export default About;
